import React from 'react'
import Item from '../../Components/JSX/Item'
import pictures from '../../Assets/menu.js'
import '../CSS/Menus.css'
const Menu = () => {
  return (
    <div className='menu'>
      <h1>Menu</h1>
      <div className='menuie'>
        <div className="meu-items">
          {pictures.map((elem, index) => {

            return <Item key={index} elem={elem}></Item>
          })}
        </div>
      </div>
    </div>
  )
}

export default Menu
